import React from 'react';

const RoundedButton = ({ onClick, children, color = '#333', textColor = 'white' }) => (
  <button
    onClick={onClick}
    style={{
      padding: '12px 30px',
      backgroundColor: color,
      color: textColor,
      border: 'none',
      borderRadius: '25px',
      cursor: 'pointer',
      fontSize: '16px',
    }}
    className="button-hover"
  >
    {children}
  </button>
);

export default RoundedButton;
